//引入react核心库
import React from 'react';
//引入reactROM库
import ReactDOM from 'react-dom';
//引入App组件
import App from './App';
//全局引入aioxs
import axios from 'axios'
//引入api
import api from './Api/api'

React.Component.prototype.axios= axios
React.Component.prototype.api = api

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
)
